    [],nt"num_tags": 3,nt"name": "sand-lake-wetland-management-district-annual-narrative-report-calendar-year-2005",nt"isopen":
    false,nt"url": null,nt"notes": "This annual narrative report for Sand Lake
    WMD outlines Refuge accomplishments during the 2005 calendar year. The report begins
    with a summary of the year's highlights and weather conditions. Land acquisition
    is covered. The report includes a planning section which discusses the master plan,
    management planning, compliance with environmental and cultural resource mandates,
    and research and investigations. Refuge administration is outlined; information
    about personnel, funding, and safety is given. Habitat management is also covered;
    subjects include wetlands, forests, croplands, grasslands, grazing, haying, fire
    management, pest control, and WPA easements. The wildlife section of the report
    discusses wildlife diversity, endangered and threatened species, waterfowl, marsh
    birds and waterbirds, shorebirds, raptors, game mammals, fisheries resources, wildlife
    propagation, and disease control. The public uses of the Refuge described in this
    report include outdoor classrooms, hunting, fishing, trapping, wildlife observation,
    outdoor recreation, and law enforcement. The equipment and facilities section of
    the report provides information about rehabilitation, major maintenance, and equipment
    replacement.",nt"owner_org": "4d7ad1cd-3641-420b-8116-e4082f49cd44",nt"extras":
